--
-- Tabla alimentos
-- Unidades usables: Kcal, g, mg, ug
--

CREATE TABLE `alimentos` (
  `id` int(11) NOT NULL,
  `identificador` int(5) NOT NULL,
  `nombre` varchar(256) NOT NULL,
  `fuente` int(2) NOT NULL,
  `grupo` int(2) NOT NULL,
  `cantidad` int(5) NOT NULL DEFAULT '100',
  `energia` decimal(7,2) NOT NULL,
  `proteinas` decimal(5,2) NOT NULL,
  `grasas` decimal(5,2) NOT NULL,
  `carbohidratos` decimal(5,2) NOT NULL,
  `colesterol` decimal(5,2) NOT NULL,
  `fibrasoluble` decimal(5,2) NOT NULL,
  `fibrainsoluble` decimal(5,2) NOT NULL,
  `fibratotal` decimal(5,2) NOT NULL,
  `sodio` decimal(7,2) NOT NULL,
  `agua` decimal(5,2) NOT NULL,
  `vitaminaa` decimal(5,2) NOT NULL,
  `vitaminab6` decimal(5,2) NOT NULL,
  `vitaminab12` decimal(5,2) NOT NULL,
  `vitaminac` decimal(7,2) NOT NULL,
  `vitaminad` decimal(5,2) NOT NULL,
  `vitaminae` decimal(5,2) NOT NULL,
  `vitaminak` decimal(5,2) NOT NULL,
  `almidon` decimal(5,2) NOT NULL,
  `lactosa` decimal(5,2) NOT NULL,
  `alcohol` decimal(5,2) NOT NULL,
  `cafeina` decimal(5,2) NOT NULL,
  `azucares` decimal(5,2) NOT NULL,
  `calcio` decimal(7,2) NOT NULL,
  `hierro` decimal(5,2) NOT NULL,
  `magnesio` decimal(7,2) NOT NULL,
  `fosforo` decimal(7,2) NOT NULL,
  `potasio` decimal(7,2) NOT NULL,
  `cinc` decimal(5,2) NOT NULL,
  `cobre` decimal(5,2) NOT NULL,
  `fluor` decimal(5,2) NOT NULL,
  `manganeso` decimal(5,2) NOT NULL,
  `selenio` decimal(5,2) NOT NULL,
  `tiamina` decimal(5,2) NOT NULL,
  `riboflavina` decimal(5,2) NOT NULL,
  `niacina` decimal(5,2) NOT NULL,
  `acidopantotenico` decimal(5,2) NOT NULL,
  `folato` decimal(5,2) NOT NULL,
  `acidofolico` decimal(5,2) NOT NULL,
  `grasastrans` decimal(5,2) NOT NULL,
  `grasassaturada` decimal(5,2) NOT NULL,
  `grasasmono` decimal(5,2) NOT NULL,
  `grasaspoli` decimal(5,2) NOT NULL,
  `cloruro` decimal(5,2) NOT NULL,
  `fecha` datetime NOT NULL DEFAULT current_timestamp(),
  `estatus` int(11) NOT NULL DEFAULT 1
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
--
-- Indexes for table `alimentos`
--
ALTER TABLE `alimentos`
  ADD PRIMARY KEY (`id`);
--
-- AUTO_INCREMENT for table `alimentos`
--
ALTER TABLE `alimentos`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT;
--
-- foreign key a fuente
--
ALTER TABLE `alimentos`
ADD FOREIGN KEY (fuente) REFERENCES fuentes(id);
--
-- foreign key a grupos
--
ALTER TABLE `alimentos`
ADD FOREIGN KEY (grupo) REFERENCES grupos(id);

